import React, { useState } from "react";
import { auth } from "../firebase"; // Import Firebase auth
import { useNavigate } from "react-router-dom"; // Import navigation hook
import admiImage from "../assets/admin.png"; // Add a default admin/user image to the 'assets' folder

const AdminDashboard = () => {
  const [pendingOrders, setPendingOrders] = useState([]);
  const [orderHistory, setOrderHistory] = useState([]);
  const navigate = useNavigate();

  const handleLogout = () => {
    auth.signOut()
      .then(() => {
        navigate("/login"); // Redirect to the login page after logout
      })
      .catch((error) => {
        console.error("Error logging out:", error.message);
        alert("Failed to log out. Please try again.");
      });
  };

  const handleCompleteOrder = (index) => {
    const completedOrder = pendingOrders[index];
    setOrderHistory((prevHistory) => [...prevHistory, completedOrder]);
    setPendingOrders((prevOrders) => prevOrders.filter((_, i) => i !== index));
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      {/* Ribbon Section */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          padding: "10px",
          backgroundColor: "#f0f0f0",
          border: "1px solid #ddd",
          borderRadius: "10px",
          marginBottom: "20px",
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <img
            src={userImage}
            alt="Admin"
            style={{
              height: "50px",
              width: "50px",
              borderRadius: "50%",
              marginRight: "10px",
            }}
          />
          <h2>Admin Dashboard</h2>
        </div>
        <button
          style={{ padding: "5px 10px", cursor: "pointer" }}
          onClick={handleLogout}
        >
          Logout
        </button>
      </div>

      {/* Pending Orders Section */}
      <div
        style={{
          margin: "20px",
          padding: "20px",
          border: "1px solid #ddd",
          borderRadius: "10px",
          backgroundColor: "#fafafa",
        }}
      >
        <h3>Pending Orders</h3>
        {pendingOrders.length === 0 ? (
          <p>No pending orders.</p>
        ) : (
          pendingOrders.map((order, index) => (
            <div
              key={index}
              style={{
                border: "1px solid #ccc",
                borderRadius: "8px",
                padding: "10px",
                marginBottom: "10px",
                textAlign: "left",
              }}
            >
              <h4>Table {order.tableNumber}</h4>
              <ul>
                {order.items.map((item, i) => (
                  <li key={i}>
                    {item.name} - ₹{item.price.toFixed(2)}
                  </li>
                ))}
              </ul>
              <h4>Total: ₹{order.total}</h4>
              <button
                onClick={() => handleCompleteOrder(index)}
                style={{
                  padding: "5px 10px",
                  cursor: "pointer",
                  backgroundColor: "#4CAF50",
                  color: "#fff",
                  border: "none",
                  borderRadius: "5px",
                }}
              >
                Mark as Complete
              </button>
            </div>
          ))
        )}
      </div>

      {/* Order History Section */}
      <div
        style={{
          margin: "20px",
          padding: "20px",
          border: "1px solid #ddd",
          borderRadius: "10px",
          backgroundColor: "#fafafa",
        }}
      >
        <h3>Order History</h3>
        {orderHistory.length === 0 ? (
          <p>No completed orders yet.</p>
        ) : (
          orderHistory.map((order, index) => (
            <div
              key={index}
              style={{
                border: "1px solid #ccc",
                borderRadius: "8px",
                padding: "10px",
                marginBottom: "10px",
                textAlign: "left",
              }}
            >
              <h4>Table {order.tableNumber}</h4>
              <ul>
                {order.items.map((item, i) => (
                  <li key={i}>
                    {item.name} - ₹{item.price.toFixed(2)}
                  </li>
                ))}
              </ul>
              <h4>Total: ₹{order.total}</h4>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
